import React from "react";
import styles from "./Overview.module.css";
import { sampleAssets, sampleMarket } from "./data";

const AssetCard = ({title, value, subtitle}) => (
  <div className={styles.assetCard}>
    <div className={styles.assetTitle}>{title}</div>
    <div className={styles.assetValue}>{value}</div>
    <div className={styles.assetSub}>{subtitle}</div>
  </div>
);

const MarketRow = ({m}) => (
  <tr>
    <td className={styles.nameCell}>{m.name}</td>
    <td>{m.price}</td>
    <td className={m.change.startsWith('+') ? styles.positive : styles.negative}>{m.change}</td>
    <td>{m.marketCap}</td>
  </tr>
);

const Overview = () => {
  return (
    <div className="container">
      <h1 className={styles.title}>Overview</h1>

      <section className={styles.top}>
        <div className={styles.portfolio}>
          <div className={styles.portHeader}>
            <div className={styles.portTitle}>Portfolio</div>
            <div className={styles.portBalance}>$17,643.41</div>
          </div>
          <div className={styles.chartPlaceholder}> {/* placeholder for chart */ }
            <div className={styles.small}>chart</div>
          </div>
        </div>

        <div className={styles.assets}>
          {sampleAssets.map(a => 
            <AssetCard key={a.id} title={a.title} value={a.value} subtitle={a.subtitle} />
          )}
        </div>
      </section>

      <section className={styles.market}>
        <div className={styles.marketHeader}>
          <h3>Market is down 0.80%</h3>
          <div className={styles.filters}>
            <button className={styles.filterBtn}>24h ▾</button>
            <button className={styles.filterBtn}>Top gainers ▾</button>
          </div>
        </div>

        <table className={styles.table}>
          <thead>
            <tr>
              <th>Name</th><th>Price</th><th>Change</th><th>Market Cap</th>
            </tr>
          </thead>
          <tbody>
            {sampleMarket.map(m => <MarketRow key={m.id} m={m} />)}
          </tbody>
        </table>

        <div className={styles.sideCard}>
          <h4>Earn free crypto</h4>
          <p>Learn about different cryptocurrencies and earn them for free!</p>
          <button className={styles.earnBtn}>Earn Now</button>
        </div>
      </section>
    </div>
  );
};

export default Overview;
